import React, { useState } from "react";
import "./css/nav.css";
function Nav() {
  const [isOpen, setIsOpen] = useState(false);
  const p = () => {
    setIsOpen(!isOpen);
  };
  return (
    <div className="nav">
      <h1>GAMING HUB</h1>
      <div className="hur">
        <button>HOME</button>
        <button>UPCOMMING MATCHES</button>
        <button>RESULT</button>
      </div>
      <div className="p">
        <button onClick={p}>PROFILE</button>
      </div>
      {isOpen && (
          <div className="dw">
            <button>DEPOSIT</button>
            <button>WITHDRAW</button>
          </div>
        )}
    </div>
  );
}
export default Nav;
